rule RTF_Byte_Nibble_Obfuscation_method1   
   {   
       strings:   
           $magic  = {7b 5c 72}   
           $update = "\\objupdate" nocase   
           $data   = "\\objdata"   nocase   
           $nibble = /([A-Fa-f0-9]\\\'[A-Fa-f0-9]{4}){4}/   
       condition:   
           $magic in (0..30) and all of them and #nibble > 10   
   }

rule RTF_Byte_Nibble_Obfuscation_method2   
   {   
       strings:   
           $magic  = {7b 5c 72}   
           $nibble = /\\objupdate.{0,1024}\\objdata.{0,1024}([A-Fa-f0-9]\\'[A-Fa-f0-9]{4}){2}/   
       condition:   
           $magic in (0..30) and all of them   
   }

rule ComputraceAgent   
   {   
    meta:   
        description = "Absolute Computrace Agent Executable"   
        thread_level = 3   
        in_the_wild = true   
    strings:   
        $a = {D1 E0 F5 8B 4D 0C 83 D1 00 8B EC FF 33 83 C3 04}   
        $mz = {4d 5a}   
        $b1 = {72 70 63 6E 65 74 70 2E 65 78 65 00 72 70 63 6E 65 74 70 00}   
        $b2 = {54 61 67 49 64 00}   
    condition:   
        ($mz at 0 ) and ($a or ($b1 and $b2))   
   }

rule tinba   
   {   
       meta:   
           author = "psrok/des"   
           module = "tinba"   
       strings:   
           $api_routine = { B8 07 00 00 00 F7 ?? 8B ?? 0F B6 ?? 03 ?? 47 80 ?? ?? 75 EC }   
           $api_loadlib = { E4 5A 57 5A }   
           $api_getmodulehandle = { 27 D4 2B C0 }   
           $rcxor = { 80 74 01 FF 08   
                      80 74 01 FF 07   
                      80 74 01 FF 06 }   

           $str1 = "RespectMyAuthority"   
           $str2 = "MozillaWindowClass"   

           $get_urls_to_inject = { 50 FF [1-5] 8D 83 [4] FF D0 85 C0 74 [1] E8 }   

       condition:   
           all of ($api*) or ( ( all of ($str*) or $get_urls_to_inject ) and $rcxor )   
   }
